import React, { Component } from 'react';
import './App.css';
import Signup from './Signup/Signup';
import Signin from './Signin/Signin';
import About from './About/About';
// import Subscribe from './Subscribe/Subscribe';
import { BrowserRouter as Router, Link, NavLink } from "react-router-dom";
import { Jumbotron, Navbar } from 'react-bootstrap';

export default class App extends Component {

  // constructor(props) {

  //   };


  render() {
    return ( 

    <div className="App">

      <Navbar default collapseOnSelect>

        <NavLink to="/Signup" className="button-signup-home"><button className="signup">SIGN UP</button></NavLink>
        <NavLink to="/Signin" className="button-signin-home"><button className="signin">SIGN IN</button></NavLink>

      </Navbar>


        <Jumbotron className="jumbotron-home">
          <h1 className="title-home">Anastasia</h1>
          <p className="first-paragraphe-home">Listen to your music, create your playlists,<br></br>Share them with others.</p>
          <p className="second-paragraphe-home">Anastasia is probably the best streaming music platform, you can subscribe or listen for free.</p>
        </Jumbotron>

          <div className="buttons-home">


            <NavLink to="/about/"><button className="about">ABOUT US</button></NavLink>
            <NavLink to="/subscribe/"><button className="subscribe">SUBSCRIBE</button></NavLink>

          </div>




         </div>

       )
  };
}
